import './App.css';
import {useState , useEffect} from "react";
import Axios from "axios";

function App() {

  const [password , setPassword] = useState("");
  const [title , setTitle] = useState("");

  const addPassword = () => {
    Axios.post("http://localhost:3001/addpassword", {password: password , title: title});
  };

  const[passList , setPassList] = useState([]);

  useEffect(() => {
    Axios.get("http://localhost:3001/showpass".then((response) => {
      setPassList(response.data);
    }))
  } , [])

  return (
    <div className="App">
      <div className="Heading">
        To store Password Enter details below
      </div>
      <div className="Addpass">
          <input type="text" placeholder="Password" onChange={(event) => {
            setPassword(event.target.value);
          }}/>
          <input type="text" placeholder="Company" onChange={(event) => {
            setTitle(event.target.value);
          }}/>
          <button onClick={addPassword}> Add Password</button>
      </div>

      {/* <div className="showPasswo">
          {passList.map((val) => {
            return <h1> {val.title} </h1>;
          })}
      </div> */}

    </div>
  );
}

export default App;
